def return_data_DF(Series):
    # create the col_name:
    name_list = []
    name_list.append(Series.loc['vital_status'])
    name_list.append(Series.name)
    name_list.append(Series.loc['pharmaceutical_therapy_drug_name'])
    name_list.append(Series.loc['gender'])
    name_list.append(Series.loc['project_id'])
    col_name = ';'.join(name_list)
    Series_final = pd.read_table(Series.loc['file_path']).set_index( ['Chromosome', 'Start']).rename( {'Beta_value': col_name}, axis=1)[col_name]
    Series_final.drop(('*', -1), inplace=True)
    # also dropping duplicated chr start coordinates, see end of file for test
    # of those, the first are kept:
    DF = Series_final.reset_index().drop_duplicates(subset=['Chromosome', 'Start']).set_index(['Chromosome', 'Start'])
    pd.DataFrame().drop_duplicates
    return DF
def write_final_DFs(DF, out_file):
    DFs = []
    for index in DF.index:
        DFs.append(return_data_DF(DF.loc[index, :]))
    if len(DFs) > 0:
        # (Pdb) pd.concat(DFs, axis=1)
        # *** ValueError: cannot handle a non-unique multi-index! -> drop
        # duplicates index chr start combination in return_data_DF
        DF_final = pd.concat(DFs, axis=1)
        DF_final = DF_final.sort_values(by=['Chromosome', 'Start'], key=natsort_keygen())
    else:
        DF_final = pd.DataFrame()
    # print(f'writing {out_file}')
    DF_final.to_csv(out_file, sep='\t',na_rep="-")

write_final_DFs(DF_meta_filtered_2, out_file)
